import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import $ from "jquery";

ReactDOM.render(<App />, document.getElementById("root"), function () {
  $("#openPriel").click(function () {
    $("#prielResume").toggle("slow");
    if ($("#liamResume").is(":visible")) {
      $("#liamResume").toggle("slow");
    }
    // if ($("#prielResume").first().is(":hidden")) {
    // $("prielResume").slideDown("slow");
    // } else {
    //   $("prielResume").hide();
    // }
  });
  $("#openLiam").click(function () {
    $("#liamResume").slideToggle("slow");
    if ($("#prielResume").is(":visible")) {
      $("#prielResume").toggle("slow");
    }
  });
});
